import './topBar.css';
import {Container,
    Navbar,
    Row,
} from 'react-bootstrap';

export default function TopBar() {
  return (
    <Navbar>
        <Container>
            <Navbar.Brand href="#home">EmojiBook</Navbar.Brand>
            <Navbar.Toggle />
            <Navbar.Collapse className="justify-content-end">
            <Navbar.Text>
                Signed in as: <a href="#login">Mark Otto</a>
            </Navbar.Text>
            </Navbar.Collapse>
        </Container>
    </Navbar>
  )
}
